import React from "react";
import styled from "styled-components";
import './App.css';

class App extends React.Component {
  render() {
    return( 
    <div>
      <Container>
        <img alt = "logo" src= "image/logo.PNG"/>
        <div className = "App">
          <div>Let's Start</div>
        </div>
      </Container>
    </div>
    );
  }
}

const Container = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: black;
  background-size: cover;
`;


export default App;
